import React from 'react';
import { Line } from 'react-chartjs-2';

const FxSpotCAT = () => {
  const LineChartData = {
    labels: [
      'Jan',
      'Feb',
      'Mar',
      'Apr',
      'May',
      'Jun',
      'July',
      'Aug',
      'Sep',
      'Oct',
      'Nov',
      'Dec',
    ],
    datasets: [
      {
        data: [12, 15, 18, 40, 35, 38, 32, 20, 25, 15, 25, 30],
        borderColor: '#f10075',
        borderWidth: 1,
        fill: false,
      },
    ],
  };

  const LineChartOptions = {
    maintainAspectRatio: false,
    legend: {
      display: false,
      labels: {
        display: false,
      },
    },
    scales: {
      yAxes: [
        {
          ticks: {
            beginAtZero: true,
            fontSize: 10,
            max: 80,
          },
        },
      ],
      xAxes: [
        {
          ticks: {
            beginAtZero: true,
            fontSize: 11,
          },
        },
      ],
    },
  };
  return (
    <div>
      <div className='container p-md-0'>
        <div className='az-content-body'>
          <div className='ht-20'></div>
          <div className='ht-20'></div>
          <h5 style={{ textAlign: 'center' }}>Fx Spot & CAT</h5>
          <div className='az-dashboard-nav'></div>
          <div className='az-dashboard-one-title'>
            <div className='media'>
              <div className='media-body'>
                <label>La Date</label>
                <h6>Mars 16, 2021</h6>
              </div>
              {/* media-body */}
            </div>
            {/* media */}
            <div className='media'>
              <div className='media-body'>
                <label>MTM CAT</label>
                <h6>454098</h6>
              </div>
              {/* media-body */}
            </div>
            <div className='az-content-header-right'>
              <div className='media'>
                <div className='media-body'>
                  <label>P&L</label>
                  <h6>R66646,4979</h6>
                </div>
                {/* media-body */}
              </div>
              {/* media */}
              <div className='media'>
                <div className='media-body'>
                  <label>Effet produit</label>
                  <h6>68686868,686</h6>
                </div>
                {/* media-body */}
              </div>
              {/* media */}
              <div className='media'>
                <div className='media-body'>
                  <label>Effet Position</label>
                  <h6>56564646,363</h6>
                </div>
                {/* media-body */}
              </div>
              {/* media */}
            </div>
          </div>
          <div className='ht-20'></div> <div className='ht-20'></div>
          <div className='row row-sm mg-b-20'>
            <div className='col-lg-7 ht-lg-100p'>
              <div className='card card-table-one'>
                <div className='row row-sm'>
                  <div className='col-sm-8 col-md-12'>
                    <div className='az-content-label mg-b-5'>
                      Evolution/Month
                    </div>
                    <p className='mg-b-20'>
                      Below is the basic line chart example.
                    </p>
                    <div className='chartjs-wrapper-demo'>
                      <Line data={LineChartData} options={LineChartOptions} />
                    </div>
                  </div>
                </div>
                {/* row */}
              </div>
              {/* row */}
            </div>{' '}
            <div className='col-lg-5 mg-t-20 mg-lg-t-0'>
              {' '}
              <div className='card card-table-one'>
                <div className='row row-sm'>
                  <div className='col-sm-8 col-md-12'>
                    <div className='az-content-label mg-b-5'>
                      Evolution/Year
                    </div>
                    <p className='mg-b-20'>
                      Below is the basic line chart example.
                    </p>
                    <div className='chartjs-wrapper-demo'>
                      <Line data={LineChartData} options={LineChartOptions} />
                    </div>

                    {/* col-6 */}
                  </div>
                  {/* row */}
                </div>
              </div>
            </div>
          </div>{' '}
        </div>
      </div>
    </div>
  );
};

export default FxSpotCAT;
